import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Navbar = () => {
  const location = useLocation();

  return (
    <nav>
      {/* Render "View Orders" only if not on /orders or /login */}
      {location.pathname !== '/orders' && location.pathname !== '/login' && <Link to="/orders">View Orders</Link>}

      {/* Conditionally show "Login" link when on the orders page */}
      {location.pathname === '/orders' && <Link to="/login">Login</Link>}
    </nav>
  );
};

export default Navbar;
